import React, { useState } from "react";

const Dog = (props) => {
  return (
    <article className="article" type="button">
      <img
        className="article__image"
        src={props.dogs.url}
        alt={props.dogs.name}
      />
      <div className="nameGender">
        <h2 className="nameGender__name">{props.dogs.name}</h2>
        <div className="nameGender__gender">
          {props.dogs.gender === "Female" ? (
            <i class="nameGender__gender--female fas fa-venus"></i>
          ) : (
            <i class="nameGender__gender--male fas fa-mars"></i>
          )}
        </div>
        <h2 className="">{props.dogs.name}</h2>
      </div>
    </article>
  );
};

export default Dog;
